class WebGazer {
  constructor() {
    // Setting up connection to WebGazer
    this.webgazer = window.webgazer
  }

  detect() {
    this.webgazer.setGazeListener((data, clock) => {
      console.log(data, clock);
    }).begin();
  }
}

export default WebGazer;
